// src/App.js
import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, useNavigate } from "react-router-dom";
import HomePage from "./pages/HomePage";
import LoginPage from "./pages/LoginPage";
import RegisterPage from "./pages/RegisterPage";
import WalletPage from "./pages/WalletPage";
import BookingHistoryPage from "./pages/BookingHistoryPage";
import Navbar from "./components/Navbar";
import FlightPage from "./pages/FlightPage";
import Dashboard from "./pages/Dashboard";

function App() {
  const [token, setToken] = useState(null);
  const [userId, setUserId] = useState(null);

  const handleLogin = (token, userId) => {
    setToken(token);
    setUserId(userId);
  };

  const handleLogout = () => {
    setToken(null);
    setUserId(null);
  };

  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/login" element={<LoginPage onLogin={handleLogin} />} />
        <Route path="/register" element={<RegisterPage />} />
        <Route path="/wallet" element={<WalletPage token={token} userId={userId} />} />
        <Route path="/flights" element={<FlightPage token={token} userId={userId} />} />
        <Route path="/bookings" element={<BookingHistoryPage token={token} userId={userId} />} />
        <Route path="/dashboard" element={<Dashboard token={token} userId={userId} onLogout={handleLogout} />} />
      </Routes>
    </Router>
  );
}

export default App;
